    # Core build/runtime dependencies (based on PyPI requires_dist for 0.3.3)
    depends_on("py-setuptools", type="build")
    depends_on("python@3.8:", type=("build", "run"))
    depends_on("py-anndata@0.7.5:", type=("build", "run"))
    depends_on("py-scanpy@1.5:", type=("build", "run"))
    depends_on("py-loompy@2.0.12:", type=("build", "run"))
    depends_on("py-umap-learn@0.3.10:", type=("build", "run"))
    depends_on("py-numba@0.41.0:", type=("build", "run"))
    depends_on("py-numpy@1.17:", type=("build", "run"))
    depends_on("py-pandas@1.1.1:", type=("build", "run"))
    depends_on("py-scipy@1.4.1:", type=("build", "run"))
    depends_on("py-scikit-learn@0.21.2:", type=("build", "run"))
    depends_on("py-matplotlib@3.3.0:", type=("build", "run"))

    # Optional extras as variants (default off)
    variant("louvain", default=False, description="Enable Louvain community detection support")
    variant("hnswlib", default=False, description="Enable HNSWLIB acceleration support")

    depends_on("py-igraph", when="+louvain", type=("build", "run"))
    depends_on("py-python-louvain", when="+louvain", type=("build", "run"))
    # Only add hnswlib dependency when requested; package may not exist in all Spack trees
    depends_on("py-hnswlib", when="+hnswlib", type=("build", "run"))

    @run_after("install")
    def install_test(self):
        with working_dir("spack-test", create=True):
            # scvelo does not provide a CLI; validate import works
            python("-c", "import scvelo as scv; print(scv.__version__)")

